export const Footer = (props) => {
    const pagesDefinition = require("../data/data.json")
    return (
        <div id='footer'>
            <div className='text-center'>
                <div className='container'>
                    <div className='section-title'>
                        <h2>{pagesDefinition.titleComments}</h2>
                    </div>
                </div>
            </div>
            <div class="fb-comments" data-href="http://localhost:3000/" data-width="100%" data-numposts="5"></div>
            <div className='container text-center'>
                <p>
                    &copy; {props.data ? props.data.textDesignBy : ''}{' '}
                    <a href='http://www.templatewire.com' rel='nofollow'>
                        {props.data ? props.data.designBy : ''}
                    </a>
                </p>
            </div>
        </div>
    )
}
